import React from'react';
import googlelogo from '../img/google.png'; // with import


const Footer = () =>(

    <div className="footer">
            <ul>
                <li><p>Made With: </p></li>
                <li><img src={"../img/weather.png"} alt="google maps logo" height="20" width="20"></img></li>
                <li><img src={googlelogo} alt="weather api logo" height="20" width="20"></img></li>
            </ul>
    </div>

);



export default Footer;
